import './Home.css';

export default function Home() {
    return (
        <div className="firstbanner .container-fluid">
            <nav>
                <ul>
                    <li>Home</li>
                    <li>Products</li>
                </ul>
            </nav>
            <div className='intro'>
                <h1>DelishDash</h1><br />
                <h2>Welcome to our culinary haven, where high-quality food products meet exceptional convenience and inspire your kitchen creativity.</h2><br/>
                <button type="button" class="btn btn-primary">Explore More</button>
            </div>
        </div>
    );
}
